import React, { useRef } from "react";
import { useNavigate, Link, Navigate } from "react-router-dom";
import Canvas from "./Canvas";
import { Button, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import RegionsList from "./RegionsList";
import useStore from "../store";

function Task() {
  let naviagate = useNavigate();

  /* Navigate to Tutorial  */
  const openTutorial = () => {
    let refrence = document.querySelector(".tutorial");
    naviagate("/Tutorial2");
  };

  return (
    <div className="container wrapper">
      <div className="text-center">
        <h2 className="d-inline-block">Image annotate prototype</h2>
        <h5
          className="d-inline-block ms-5 tutorial"
          style={{ cursor: "pointer" }}
          onClick={openTutorial}
        >
          Tutorial<img src="/logo.png" style={{ width: "50px" }}></img>
        </h5>
        <p className="description me-5">
          Draw objects conturs on top of the image
        </p>
      </div>

      <RegionsList />
    </div>
  );
}

export default Task;
